import React from "react";
import './Style.css';

function FunComp() {
    return <>
        <div className="header">
            <div class="logo">
                <h1 class="logo-text"><span>Free</span>Content</h1>
            </div>

            {/* <!-- Toggle fa-bars --> */}
            <i class="fa fa-bars menu-toggle"></i>

            {/* <!-- Navigation Bar --> */}
            <ul class="nav">
                <li><a href="">Home</a></li>
                <li><a href="">About</a></li>
                <li><a href="">Services</a></li>
             </ul>


        </div>
    </>
}

export default FunComp;
